function divide(n) {
    this.theta = 360/n;
    for(var i=0.5; i<n; i++){
        var start = pt(this.i_radius*Math.cos((i*this.theta+90)*Math.PI/180),this.i_radius*Math.sin((i*this.theta+90)*Math.PI/180)),
            end = pt(this.o_radius*Math.cos((i*this.theta+90)*Math.PI/180),this.o_radius*Math.sin((i*this.theta+90)*Math.PI/180));
        this.addDivider(start,end,(i-0.5));
    }
}

1339.source:
function rotate(dir) {
    var self = this;
    if(dir=='cw'){
        this.position++;
        this.setRotation(this.getRotation()-this.theta*Math.PI/180);
    }
    else {
        this.position--;
        this.setRotation(this.getRotation()+this.theta*Math.PI/180)
    }
    this.icons.forEach(function(ea){
        ea.setRotation(-self.getRotation());
    });
}

1348.source:
function ticTic(times) {
    var self = this;
    if(times==0||times===NaN)return;
    times-=1;
    this.withCSSTransitionDo(this.setRotation.curry(this.getRotation()+10*Math.PI/180), 100, function(){
        this.withCSSTransitionDo(this.setRotation.curry(this.getRotation()-2.5*Math.PI/180), 50, function(){
            self.ticTic(times)
        })
    });
}

