function onDropOn() {
    // show(this.getPosition())
    var pos = this.getPosition(),
        vsbBnds = $world.getBounds(),
        dist = this.getExtent().y*0.6,
        r = this.getMorphNamed('main_wheel').getExtent().y/2;
    if(this.closedTo(pos.x, vsbBnds.x,dist))
        this.setPosition(pt(vsbBnds.x,pos.y))
    else if(this.closedTo(pos.x, (vsbBnds.x+vsbBnds.width),dist))
        this.setPosition(pt((vsbBnds.x+vsbBnds.width),pos.y))
    else if(this.closedTo(pos.y, vsbBnds.y,dist))
        this.setPosition(pt(pos.x,vsbBnds.y))

        // this.get('main_wheel').ticTic(3)
    if(this.onEdge()==='left'){
      this.addRotationIcons(pt(15,r+15),pt(15,-(r+15)));
      this.getMorphNamed('cwIcon').setRotation(Math.PI)
    }
    else if(this.onEdge()==='right'){
        this.addRotationIcons(pt(-15,-(r+15)),pt(-15,r+15));
        this.getMorphNamed('ccwIcon').setRotation(Math.PI)
    }
    else if(this.onEdge()==='top'){
        this.addRotationIcons(pt((r+15),15),pt(-(r+15),15));
    }
    else if (this.onEdge()==='bottom'){
        this.addRotationIcons(pt((r+15),-15),pt(-(r+15),-15));
    }
    else {
        this.addRotationIcons()
    }
    if(this.onEdge()!==false)
        this.getMorphNamed('main_wheel').ticTic(3)

}

