function onEdge() {
    var vsbBounds = $world.visibleBounds(),
        x = this.getPosition().x,
        y = this.getPosition().y;
        if(x<=vsbBounds.x)
            return 'left'
        else if(x>=vsbBounds.x+vsbBounds.width )
            return 'right'
        else if(y<=vsbBounds.y)
            return 'top'
        else if(y>= vsbBounds.y+vsbBounds.height)
            return 'bottom'
        else
            return false
}
